Автомобиль находится на торговой площадке Probeg.by по адресу ул. Притыцкого 60В. 

Комплектация: климат контроль, круиз контроль, эл. регулировка боковых зеркал, обогрев зеркал, мультируль, подогрев пердних и задних сидений, датчики дождя и света ,тонировка ,бесключевой доступ ,антиблокировочная система (ABS), система распределения тормозного усилия (EBD), вспомогательная система торможения (BAS), система электронного контроля устойчивости (ESP).

Наши услуги:

- Обмен Вашего автомобиля на новый или с пробегом (возможна доплата с любой стороны);
- Кредитование/лизинг;
- Срочный выкуп Вашего автомобиля;
- Выкуп кредитных и лизинговых автомобилей;
- Оформление полного пакета документов для постановки автомобиля на учет;

Информация не является публичной офертой.
